    private static void babbleSort(int[] mass) {
        for (int i = 0; i < mass.length; i++) {
            for (int j = 0; j < mass.length - i - 1; j++) {
                if (mass[j] > mass[j + 1]) {
                    int temp = mass[j];
                    mass[j] = mass[j + 1];
                    mass[j + 1] = temp;
                }
            }
        }
    }

    private static void mySort(int[] mass) {
        for (int i = 1; i < mass.length; i++) {
            for (int j = i; j > 0; j--) {
                if (mass[j] < mass[j - 1]) {
                    int temp = mass[j];
                    mass[j] = mass[j - 1];
                    mass[j - 1] = temp;
                }
            }
        }
    }

    private static void insertionSort(int[] mass) {
        for (int i = 1; i < mass.length; i++) {
            int temp = mass[i];
            int j = i - 1;
            while (j >= 0 && temp < mass[j]) {
                mass[j + 1] = mass[j];
                j--;
            }
            mass[j + 1] = temp;
        }
    }
